import './searchCar.css'

function SearchCar( {handleSearch} ) {
  console.log(handleSearch);

  return (
    <div className="search">

     <label>Car Search</label>
      <input name="search" id="search" oneChange={handleSearch} />
    </div>
  )
}


export default SearchCar;
